import Lesson from './Lesson';

export default function Main(props) {
	const lesson = props.data.map((item, i) => {
		return (
			<p key={i}>
				{' '}
				<Lesson data={props.data} />
			</p>
		);
	});
	return <main>{lesson}</main>;
}
